window.bookSummaryJSON = "<p><b>#1 <i>New York Times</i> bestseller Sherrilyn Kenyon brings us the latest adventure in the Deadman's Cross saga with <i>At Death's Door</i>, an epic pirate fantasy perfect for her millions of Dark-Hunter fans.</b><br><br>Welcome to the latest Deadmen’s Quest...<br><br>Valynda Moore was born cursed. So when she dies as the result of a spell gone wrong and is trapped in the body of a voodoo doll, she expects nothing else from her messed up life. Until Thorn, leader of the Hellchasers, offers her a chance at redemption and a new life.<br><br>But nothing has ever gone her way, for the Malachai, the very beast she and her crew of Deadmen have sworn to keep locked away, has risen. And this time he’s taken prisoners. Valynda must keep her wits about her or be denied her salvation and forced to watch as the entire world falls into the hands of absolute evil.<br><br>It’s a demon-eat-demon world where the stakes have never been higher and either redemption or the ultimate betrayal waits for her At Death’s Door.</p>"; 
